ith fellow Users, or if you otherwise use our Services, you may be required or otherwise have the option to submit certain information, some of which may personally identify you. Such information may include any questions, comments or problems you report to us, your first and last name, your geo-location (if you assent). You are solely responsible for ensuring the accuracy of the Personal Information you submit.</p><p>You are responsible for ensuring the accuracy of the Personal Information you submit to Home networks. You can see, review and change your Personal Information by logging into your account on the Website. Inaccurate information will affect your use of our Services and our ability to contact you as described in this Privacy Policy.</p><p>You agree that you are the lawful owner having all rights, title and interest in your information, and further agree that you are solely responsible and accountable for Your Information and that we act as a mere platform for your online distribution and publication of Your Information.</p><h3><strong>Use of personal information</strong></h3><p>We may use the information to connect with you.</p><p>We may use your information to recommend certain Listings, send you marketing communications and push notifications, communicate with you about our Services, updates, promotional offers, and let you know about our policies and Terms. These communications may be made via email or WhatsApp.</p><p>We use the information we have to help verify accounts and activity, and to promote safety and security on our Services, such as by investigating suspicious activity or violations of our Terms or policies.&nbsp;</p><p>Your password is the key to your account. We urge to you to use unique numbers, letters and special characters, and to keep your password secure. You agree to immediately notify Home networks of any unauthorized use of your password or account or any other breach of security and we recommend that you exit from your account 