</h3><h3><strong>Deactivating account</strong></h3><p>Upon your request, or in the event we terminate your account in accordance with our Terms, we will deactivate your registered account within ten (10) days of our receipt of such request. If you no longer wish to receive emails, you may opt-out of receiving them through your account settings, by following the instructions included in each email, or by emailing us at contact@homenetworks.in.&nbsp;</p><p>However, we reserve the right to send you certain service announcements and administrative messages, without offering you an opportunity to opt out. In the case of an important message from us regarding your User Content, modifications to the Services, our Terms or this Privacy Policy, we reserve the right to contact you by email.</p><h3><strong>Content</strong></h3><p>The Site contains content which includes Your Information, home networks \'s information and information from other users. You agree not to copy, modify, or distribute such content (other than Your Information), Home networks’ copyrights or trademarks. When you give us any content as part of Your Information, you are granting us a non-exclusive, worldwide, perpetual, irrevocable, royalty-free, sub-licensable right and license to use, reproduce, , publish, translate, distribute, perform and display such content (in whole or part) worldwide through the Site as well as on any of our affiliates or partners websites, publications and mobile platform. We need these rights with respect to the content in Your Information in order to host and display your content. If you believe that there is a violation, please notify us at contact@homenetworks.in.</p><h3><strong>Age matters</strong></h3><p>You must be 16 years of age or older and able to form legally binding contracts with us to use the Services.</p><p>The Services are not directed at children under the age of 16. In the event that we learn that we have collected Personal Information from a child under age 16without parental consent, we will delete that information as quickly as possible.</p><h3><strong>Liability</strong></h3><p>You agree not to hold Home networks or any of its officers, employees, agents responsible or accountable for any of your listing, postings or information and nor shall we, our officers, employees or agents be liable for any misuse, illegal activity or third party content as most postings, listings or information are generated by various users directly and we do not have any role in the creation, publication or distribution of the posting, listing or information, nor are we in a position to have editorial control over the substance or content contained in the listings, postings, or information, save and except to the extent provided in sec above.</p><h3><strong>Changes</strong></h3><p>We may update this AUP or the listing policy at any time and may notify you of such updates via a post on the boards and /or through email communications. The modified AUP and /or Listing Policy shall come into effect either at the time you place your next posting, listing or information on the Site or after a period of 30 days from the date of the update, whichever is sooner. If we or our corporate affiliates are involved in a merger or acquisition, we may share personal information with another company, but this AUP shall continue to apply.</p><p>For Interior works:</p><p>At Home networks one of our main priorities is the privacy of our visitors. This Privacy Policy document contains types of information that is collected and recorded by Home networks and how we use it.</p><p>If you have additional questions or require more information about our Privacy Policy, please write us at contact@homenetworks.in.</p><p>This Privacy Policy applies only to our online activities and is valid for visitors to our website with regards to the information that they shared and/or collect in Home networks. This policy is not applicable to any information collected offline or via channels other than this website. Our Privacy Policy was created with the help of the Privacy Policy Generator.</p><p>Page 2 of interior works:</p><h3><strong>Consent</strong></h3><p>By using our website, you hereby consent to our term and privacy policy.</p><h3><strong>Information we collect.&nbsp;</strong></h3><p>The personal information that you are asked to provide, and the reasons why you are asked to provide it, will be made clear to you at the point we ask you to provide your personal information.</p><p>If you contact us directly, we may receive additional information about you such as your name, email address, phone number, the contents of the message and/or attachments you may send us, and any other information you may choose to provide.</p><p>When you register for an Account, we may ask for your contact information, including items such as name, company name, address, email address, and telephone number.</p><h3><strong>How we use your information</strong></h3><p>We use the information we collect in various ways, including to:</p><ol><li>Provide, operate, and maintain our website.</li><li>Improve, personalize, and expand our website.</li><li>Understand and analyse how you use our website</li><li>Develop new products, services, features, and functionality</li><li>Communicate with you, either directly or through one of our partners, including for customer service, to provide you with updates and other information relating to the website, and for marketing and promotional purposes</li><li>Send you emails.</li><li>Find and prevent fraud.</li></ol><h3><strong>Log Data</strong></h3><p>We may also collect log information that your browser sends whenever you visit our site. The information collected by log files include internet protocol (IP) addresses, browser type, Internet Service Provider (ISP), date and time stamp, referring/exit pages, and possibly the number of clicks. These are not linked to any information that is personally identifiable. The purpose of the information is for analysing trends, administering the site, tracking users’ movement on the website, and gathering demographic information. All hosting companies do this and a part of hosting services’ analytics.</p><h3><strong>Communication</strong></h3><p>To provide newsletters, marketing or promotional materials and other information that may be of interest to you, your Personal Information is used. You may opt out of from these services by following the unsubscribe link or instructions provided in any email we send or contact with Home networks customer care support.</p><p>&nbsp;</p><h3><strong>Third-Party Privacy Policies</strong></h3><p>Home networks Privacy Policy does not apply to other advertisers or websites. Thus, we are advising you to consult the respective Privacy Policies of these third-party ad servers for more detailed information. It may include their practices and instructions about how to opt-out of certain options.</p><p>You can choose to disable cookies through your individual browser options. To know more detailed information about cookie management with specific web browsers, it can be found at the browsers’ respective websites.</p><h3><strong>Advertising Partners Privacy Policies</strong></h3><p>Third-party ad servers or ad networks uses technologies like cookies, JavaScript, or Web Beacons that are used in their respective advertisements and links that appear on Home networks, which are sent directly to users’ browser. They automatically receive your IP address when this occurs. These technologies are used to measure the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on websites that you visit.</p><p>Note that Home networks has no access to or control over these cookies that are used by third-party advertisers.</p><p>You may consult this list to find the Privacy Policy for each of the advertising partners of Home networks.</p><p>Data Protection Rights</p><ul><li>We would like to make sure you are fully aware of all of your data protection rights. Every user is entitled to the following:</li><li>The right to access – You have the right to request copies of your personal data. We may charge you a small fee for this service.</li><li>The right to rectification – You has the right to request that we correct any information you believe is inaccurate. You also have the right to request that we complete the information you believe is incomplete.</li><li>The right to erasure – You have the right to request that we erase your personal data, under certain conditions.</li><li>The right to restrict processing – You have the right to request that we restrict the processing of your personal data, under certain conditions.</li><li>The right to object to processing – You have the right to object to our processing of your personal data, under certain conditions.</li><li>The right to data portability – You have the right to request that we transfer the data that we have collected to another organization, or directly to you, under certain conditions.</li><li>If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us.</li></ul><h3><strong>Minor\'s Privacy</strong></h3><p>Our services do not address any minor. Please contact us if you are a parent or guardian of the minor who has provided information to our site. We don’t hesitate in removing the information provided by the minor without the consent of their parents or guardian.</p><p>Homenetworks does not knowingly collect any Personal Identifiable Information from children under the age of 16. If you think that your child provided this kind of information on our website, we strongly encourage you to contact us immediately and we will do our best efforts to promptly remove such information from our records.</p><p>Homenetworks always encourage parents and guardians to observe, participate in, and/or monitor and guide their children s online activity.</p><p>If you have any question regarding privacy policy and terms please contact us or mail us: contact@homenetworks.in</p><p>Homenetworks interiors ensures that delivered products will be free from manufacturing defects and hassles in design and workmanship.</p><p>Warranty Period: The Warranty period begins with the delivery date of the Product in accordance with the Warranty duration for every product displayed on the product detail page with the complete product description.</p><p>Eligibility: This Warranty is non-transferable. For availing the warranty policy, you must have a valid invoice regards of the Product, as and when requested by us or our representative(s). Any changes or alterations made to the products post-order are not advisable as they may void the entire Warranty.</p><p>In case of repairing any damaged Product under this Warranty policy, we will pick up the damaged Product from the address where such Product was delivered. After repairing, we will deliver the repaired Product back to the original delivery address as asked.</p><p>Exclusions: This Warranty will not cover the following types of damages:</p><ul><li>defects identified due to inadequate maintenance of the product.</li><li>Mishandling, excessive loading and negligence in usage.</li><li>Wear and tear due to regular usage of the product.</li><li>Any variations due to the natural characteristics of the materials used.</li></ul><p>Henceforth, Homenetworks \'s decision shall be finalized based on the nature of the defect and the applicability of the Warranty.</p><p>Disclaimer: Homenetworks will not be liable for any incidental, special or consequential damages, including loss of profits or revenues or any other costs or damages, in any circumstance, if it comes under a result of a breach of contract or warranty, tort or otherwise.</p><h3><strong>This Warranty does not include:</strong></h3><ol><li>minor issues in the Product that widely meet design specifications or imperfections that do 